import React from 'react'
import PropTypes from 'prop-types'

function Food ({name, image, rating}){

    return <div>
        <h2>i like {name} and rating {rating}/5.0</h2>
        <img src={image} alt=""/>

    </div>
}

const foodArr = [
    {
        id:1,
        name: 'k',
        image: 'data:image/jpeg;base64,',
        rating: 4.2
    },
    {
        id:2,
        name: 'i',
        image: 'data:image/png;base64,',
        rating: 3.0
    },
    {
        id:3,
        name: 'n',
        image: 'data:image/jpeg;base64,',
        rating: 2.9
    },
    {
        id:4,
        name: 'g',
        image: 'data:image/jpeg;base64,',
        rating: 5.0
    },
]

Food.propTypes = {
    name: PropTypes.string.isRequired,
    image: PropTypes.string.isRequired,
    rating: PropTypes.number.isRequired
}

function App() {
  return (
    <div className="App">
        {foodArr.map(row => <Food key={row.id} name={row.name} image={row.image} rating={row.rating}></Food>)}
    </div>
  );
}

export default App;
